import "./topbar.scss";

function Topbar() {
  return (
    <div className="topbar">
      <div className="wrapper">
        <div className="left">
          <a href="#intro">Intro</a>
        </div>
        <h1>Hello</h1>
        <div className="right"></div>
      </div>
    </div>
  );
}

export default Topbar;
